import qr from "qrcode";
import { createCanvas, loadImage } from "canvas";
import Symbology from "symbology";
const { SymbologyType, createStream, createFile, OutputType, EncodingMode } =
  Symbology;
import fs from "fs";
import path from "path";

// create qr code
export const createQrCode = async (req, res) => {
  const { data, width, height, name } = req.query;
  const qrOption = {
    margin: 2,
    width: width,
    height: height,
  };

  if (data.length === 0) {
    res.send("Empty Data");
  }

  const newData = data.replace(/\%20/gi, " ").toString();
  console.log("newData", newData);

  const src = `./asset/images/qr/${name}.png`;

  const stream = fs.createWriteStream(src);
  qr.toFileStream(stream, newData, qrOption);

  res.setHeader("content-type", "image/png");
  res.sendFile(path.resolve(src));
};

// function to create canvas for qrcode
async function create(
  dataForQRcode,
  center_image,
  width,
  cwidth,
  qrWidth,
  qrHeight
) {
  const canvas = createCanvas(width, width);
  const qrOption = {
    margin: 2,
    width: qrWidth,
    height: qrHeight,
  };
  qr.toCanvas(canvas, dataForQRcode, qrOption, {
    errorCorrectionLevel: "H",
    margin: 1,
    color: {
      dark: "#000000",
      light: "#ffffff",
    },
  });

  const ctx = canvas.getContext("2d");
  const img = await loadImage(center_image);
  const center = (width - cwidth) / 2;
  ctx.drawImage(img, center, center, cwidth, cwidth);
  return canvas.toDataURL("image/png");
}

// create qr code with logo
export const createQrCodeWithLogo = async (req, res) => {
  const { data, width, height, name } = req.query;

  const qrCode = await create(
    data,
    "data:image/png;base64,",
    150,
    75,
    width,
    height
  );

  res.send(`<img src="${qrCode} ">`);
};

// create barcode type code128
export const createBarcode = async (req, res) => {
  const { width, height, name, text } = req.query;

  const { data } = await createFile(
    {
      symbology: SymbologyType.CODE128,
      fileName: `${name}.png`,
      height,
      whitespaceWidth: width,
      showHumanReadableText: false,
    },
    text
  );

  res.setHeader("content-type", "image/png");
  res.sendFile(path.resolve(`${name}.png`));
};
